CREATE TABLE karta (
    karta_id             INTEGER NOT NULL,
    vrijeme_polaska      VARCHAR2(9) NOT NULL,
    datum_polaska        DATE NOT NULL,
    kupac_kupac_id       INTEGER,
    relacija_rel_id      INTEGER,
    vrijeme_kupnje       VARCHAR2(9) NOT NULL,
    rezervacija_sjedala  CHAR(1) NOT NULL,
    redni_broj_ulaz      INTEGER NOT NULL,
    redni_broj_izlaz     INTEGER NOT NULL,
	cijena_kon 			 INTEGER
);

ALTER TABLE karta ADD CONSTRAINT karta_pk PRIMARY KEY ( karta_id );

CREATE TABLE kupac (
    kupac_id          INTEGER NOT NULL,
    ime               VARCHAR2(15) NOT NULL,
    prezime           VARCHAR2(20) NOT NULL,
    adresa            VARCHAR2(50) NOT NULL,
    tel               INTEGER NOT NULL,
    dob               DATE NOT NULL,
    popust_popust_id  VARCHAR2(20) NOT NULL
);

ALTER TABLE kupac ADD CONSTRAINT kupac_pk PRIMARY KEY ( kupac_id );

CREATE TABLE popust (
    popust_id   VARCHAR2(20) NOT NULL,
    vrijednost  INTEGER NOT NULL
);

ALTER TABLE popust ADD CONSTRAINT popust_pk PRIMARY KEY ( popust_id );

CREATE TABLE postaja (
    postaja_id         INTEGER NOT NULL,
    ime_naselja        VARCHAR2(60) NOT NULL,
    zaposlenik_zap_id  INTEGER NOT NULL
);

ALTER TABLE postaja ADD CONSTRAINT postaja_pk PRIMARY KEY ( postaja_id );

CREATE TABLE relacija (
    rel_id              INTEGER NOT NULL,
    cijena_relacije     NUMBER NOT NULL,
    vremensko_trajanje  VARCHAR2(9) NOT NULL,
    vlak_vlak_id        INTEGER NOT NULL
);

ALTER TABLE relacija ADD CONSTRAINT relacija_pk PRIMARY KEY ( rel_id );

CREATE TABLE stajalista (
    redni_broj          INTEGER NOT NULL,
