SELECT * FROM stajalista WHERE relacija_rel_id=10;

SELECT MAX(AVG(placa))
FROM zaposlenik
WHERE zap_id IN 
(
    SELECT zap_id
    FROM zaposlenik
    WHERE placa>1
)
GROUP BY zap_id;

SELECT z.ime, z.prezime, z.opis_posla, v.vlak_id
FROM zaposlenik z INNER JOIN vlak v
ON z.zap_id=v.zaposlenik_zap_id
ORDER BY z.ime;

SELECT k.ime, k.prezime, k.popust_popust_id, r.kupac_kupac_id, r.vrijeme_polaska, r.datum_polaska,
       r.cijena_kon, r.relacija_rel_id, r.redni_broj_ulaz, r.redni_broj_izlaz
FROM kupac k INNER JOIN karta r
ON k.kupac_id=r.kupac_kupac_id
ORDER BY r.datum_polaska;

SELECT r.rel_id AS "Redni broj vlaka", r.cijena_relacije AS "Cijena putovanja", r.vremensko_trajanje AS "Trajanje putovanja", v.broj_sjed AS "Broj sjedala u vlaku", v.vrsta_prijevoza AS "Vrsta vlaka" 
FROM relacija r INNER JOIN vlak v
ON v.vlak_id=r.vlak_vlak_id
ORDER BY v.vrsta_prijevoza;

